import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  template: `
  <select [(ngModel)]="selectedLanguage" value="selectedLanguage" (change)="changeLanguage()">
    <option value="en">English</option>
    <option value="fr">French</option>
  </select>
`
})
export class AppComponent {
  title = 'nuitInfofront';
}
